import { NavLink } from "react-router-dom";
import "./Navbar.css";
export function Navbar() {
    return(
    <div className="nav-container">
        <div className="logo">Thrift Store</div>
            <div className="serch-bar">
            <input className="nav-input" type="text" placeholder="Search" />
        </div>
        <div className="menu-items">
            <ul className="menu-items">
                <li className="list-item"><NavLink className="menu-link" to="/login-signup/login.html">Login</NavLink></li>
                <li className="list-item"><Navlink className="menu-link" to="/wishlist"><i
                    className="fa fa-heart">Wishlist</i></Navlink></li>
                <li className="list-item"><Navlink className="menu-link" href="/cart-page">Cart</Navlink></li>
            </ul>
        </div>
    </div>
    )
}
